import React, { Component } from "react";
import Button from "./../../components/Button/Button";
import LogInForm from "../../components/Forms/LogInForm";
import "./../../App.css";
import "./Login.css";


export default function Login () {

return (
  <div>
    <header>
    <img className="arrow-back" src={require('./../../graphics/back_arrow_idle.png')} alt="back arrow" height='40' width ='40'></img>


    <div className="centering">
     <div className="title">
       <div className="app-title">We are Happy to have you back!</div>
      </div>
    </div>

      <div className="log-in">
      <div className="app-headline">Log In</div>
      </div>

    <img className="paper-plane" src={require('./../../graphics/message_idle.png')} alt="Tripster Logo" height='40' width ='40'></img>
    </header>

    <div className="centering">
      <LogInForm/>
    </div>

    <div className="centering">
      <Button text="Log in" type="login" />
    </div>


  </div>
  )
 }
